#!/usr/bin/env python3
import base64,marshal,zlib,hashlib,sys,gc
from Crypto.Cipher import AES
from Crypto.Util.Padding import unpad
from Crypto.PublicKey import RSA
from Crypto.Signature import pkcs1_15
from Crypto.Hash import SHA256

payload = ''.encode()
signature = base64.b64decode('')
public_key = RSA.import_key(b'-----BEGIN PUBLIC KEY-----\nMIIBIjANBgkqhkiG9w0BAQEFAAOCAQ8AMIIBCgKCAQEAoPo+UuXmMRW5MCaVw+4/\niv3jHEGqdbRXQvGDcsFLpWFyTwLGPd9ZfPWXcIZwnQBAIykfDR6Po2PGu1Z29Ol5\nmmGvYdAj20VwJNx2QUitp8vZEfu5tDrIyOJZT2sUGqEuU9oCd8nDZF3wTSbl0GEt\nEKC8KeIzjKyUV/u/R2Bv6Bh3JvCgoNP9QNJPmotHFRBznbV2qcucceFfOtiJC/oU\nF6TAuTtIDWCwNC0l46tUjqqlrkUuZnsUE7VDkiC3u0S0QKSUw0EH952wMnM3Y2d0\nr9Pm8NPc6k9AfKSYVgKf+7PlgNP74dhdQdUtopbejraCGu+6Z8bUAfDvKFhi2lyD\nmwIDAQAB\n-----END PUBLIC KEY-----')

try:
    pkcs1_15.new(public_key).verify(SHA256.new(payload), signature)
except:
    sys.exit(0)

raw = bytearray(base64.b64decode(payload))

iv = raw[:16]
salt = raw[16:32]
enc = raw[32:]

key = hashlib.pbkdf2_hmac("sha256", iv, salt, 20000, 32)

cipher = AES.new(key, AES.MODE_CBC, iv)
dec = bytearray(unpad(cipher.decrypt(enc), 16))

code = marshal.loads(zlib.decompress(dec))
exec(code, globals(), globals())

for i in range(len(raw)):
    raw[i] = 0
for i in range(len(dec)):
    dec[i] = 0

key = b'\x00' * 32
del code
gc.collect()
